import React from 'react';
import ReactDOM from 'react-dom';
import './about.css';
import { sideMenu as Menu } from './components/sideMenu.js';

ReactDOM.render(
  <div id="outer-container">
    <Menu pageWrapId={ "page-wrap" } outerContainerId={ "outer-container" } />
    <div id="page-wrap">
    <center>This is the about page. Officer information and stuff goes here.</center>
    </div>
  </div>,
  document.getElementById('root')
);
